    this.loadMe = function(url, callback){
      var head = document.documentElement,
          script = document.createElement("script");

      script.src = url
      script.type  = "application/javascript";

      var done = false;

      script.onload  = script.onreadystatechange = function(){
        if (!done && (!this.readyState ||  this.readyState ===  "loaded" ||  this.readyState ===  "complete")){
          done = true;

          try {
            callback();
          }
          catch(err) {
            callback;
          }
          console.log('Loaded - '+url);


          script.onload = script.onreadystatechange = null;
          if (head && script.parentNode){
            head.removeChild(script);
          }
        }
      }
      head.insertBefore(script,head.firstChild) || head.appendChild(script);

      return "done";
    }
    this.import = function(){
        var i, sum = 0;
        for (i = 0; i < (arguments.length-2); i++) {
            scope = "http:"+this.libraries[arguments[i]];
            this.loadMe(scope,s=1);
            scope=null;
        }
        this.loadMe("http:" + this.libraries[arguments[i]],arguments[i+1]);
        return undefined;
    }
